import React from 'react'
import CIcon from '@coreui/icons-react'

const _nav =  [
  {
    _tag: 'CSidebarNavItem',
    name: 'Dashboard',
    to: '/dashboard',
    icon: <CIcon name="cil-speedometer" customClasses="c-sidebar-nav-icon"/>,
    badge: {
      color: 'info',
      text: 'NEW',
    }
  },

  {
    _tag: 'CSidebarNavTitle',
    _children: ['Components']
  },
  {
    _tag: 'CSidebarNavItem',
    name: 'New Tasks',
    to: '/widgets',
    icon: 'cil-calculator',
    badge: {
      color: 'info',
      text: '50',
    },
  },
  {
    _tag: 'CSidebarNavDropdown',
    name: 'Orders',
    route: '/base',
    icon: 'cil-puzzle',
    _children: [


      {
        _tag: 'CSidebarNavItem',
        name: 'My assigned Orders',
        to: '/base/cards',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Completed Orders',
        to: '/base/cards',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'My ongoing Orders',
        to: '/base/cards',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'My orders under review',
        to: '/base/cards',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'My orders being reviewed',
        to: '/base/cards',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Cancelled Orders',
        to: '/base/cards',
      },

    ],
  },
  {
    _tag: 'CSidebarNavDropdown',
    name: 'Finances',
    route: '/buttons',
    icon: 'cil-cursor',
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'Buttons',
        to: '/buttons/buttons',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Brand buttons',
        to: '/buttons/brand-buttons',
      },

    ],
  },

  {
    _tag: 'CSidebarNavDropdown',
    name: 'Icons',
    route: '/icons',
    icon: 'cil-star',
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'CoreUI Free',
        to: '/icons/coreui-icons',
        badge: {
          color: 'success',
          text: 'NEW',
        },
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'CoreUI Flags',
        to: '/icons/flags',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'CoreUI Brands',
        to: '/icons/brands',
      },
    ],
  },


  {
    _tag: 'CSidebarNavDivider'
  },
  {
    _tag: 'CSidebarNavTitle',
    _children: ['Extras'],
  },

  {
    _tag: 'CSidebarNavItem',
    name: 'Logout',
    icon: 'cil-ban',

  },

]

export default _nav
